def filter_chars(string):
    filtered_string = ""
    for index, char in enumerate(string):
        if index < 55 or index >= 84 or ord(char) <= ord(';') or ord(char) >= ord('z'):
            filtered_string += char

    return filtered_string
```
Note: The above code assumes that indices start from 0, so the given indices 55 and 84 in the text specification are interpreted as 54 and 83 in the code.
